import styled from 'styled-components'

const WrapperIcone = styled.div`
  font-size: 16px;
  margin-left: 5px;
  font-weight: bold;
  transition: 400ms;
  margin: 5px;
  :hover {
    cursor: pointer;
    transform: scale(1.1);
  }
`

export { WrapperIcone }
